<div class="entities" style="line-height: 2.5; direction: ltr">A stratovolcano , also known as a composite volcano , is a conical volcano built up by many layers ( strata ) of hardened lava , tephra , pumice , and volcanic ash . Unlike shield volcanoes , stratovolcanoes are characterized by a steep profile and periodic explosive eruptions and effusive eruptions , although some have collapsed craters called calderas . The lava flowing from stratovolcanoes typically cools and hardens before spreading far due to high viscosity . The magma forming this lava is often felsic , having high-to-intermediate levels of silica ( as in rhyolite , dacite , or andesite ) , with lesser amounts of less-viscous mafic magma . Extensive felsic lava flows are uncommon , but have travelled as far as .</div>
